        public static string ParagraphFormat = "{\"sections\":[{\"blocks\":[{\"characterFormat\":{\"fontColor\":\"#4472C4FF\"},\"paragraphFormat\":{\"afterSpacing\":36,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"List of text alignment options\",\"characterFormat\":{\"fontSize\":18,\"fontFamily\":\"Monotype Corsiva\",\"fontColor\":\"#4472C4FF\",\"fontSizeBidi\":18,\"fontFamilyBidi\":\"Monotype Corsiva\"}}]},{\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Left-aligned\",\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"afterSpacing\":18,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The giant panda, which only lives in China outside of captivity, has captured the hearts of people of all ages across the globe. From their furry black and white bodies to their shy and docile nature, they are considered one of the world's most loved animals.\",\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"beforeSpacing\":18,\"textAlignment\":\"Center\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Centered\",\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"afterSpacing\":18,\"textAlignment\":\"Center\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"A characteristic of the giant panda that has mystified scientists is their movable, elongated wrist bone that acts like an opposable thumb. This human-like quality that helps give them even more of a cuddly-bear appearance enables the giant panda to pick up objects and even eat sitting up.\",\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"beforeSpacing\":18,\"textAlignment\":\"Right\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Right-aligned\",\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"afterSpacing\":18,\"textAlignment\":\"Right\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Giant pandas are generally referred to as bears and are typically called panda bears rather than giant pandas. Though we may think they look like bears, there has been a great deal of discussion for decades about where giant pandas fit in the animal kingdom. Much of the debate has been whether they are more closely related to the red panda, once thought to be a member of the raccoon family, than the bear family.\",\"characterFormat\":{\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"fontFamilyBidi\":\"Calibri\"}}]},{\"characterFormat\":{\"bold\":true,\"fontSize\":14,\"fontFamily\":\"Calibri\",\"fontColor\":\"empty\",\"boldBidi\":true,\"fontSizeBidi\":14,\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"beforeSpacing\":18,\"textAlignment\":\"Justi