.NET Core is the web development framework that comes together with the new .NET Core and, besides all the new features, also adopts a significantly new approach to web development. The first chapter starts by going through the history of Microsoft's web stack to show the motivations that led to this framework. Later, it moves to more practical matters, like showing you how to get started with .NET Core and describing the foundations of the framework.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 1\" }, \"inlines\": [{ \"name\": \"_Toc523387946\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388456\", \"bookmarkType\": 0 }, { \"text\": \"Chapter 2 What are .NET Core and ASP.NET Core?\" }, { \"name\": \"_Toc523387946\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388456\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Before trying to understand the reason for its existence, let's first try to define what .NET Core and ASP.NET Core are.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 2\" }, \"inlines\": [{ \"name\": \"_Toc523387947\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388457\", \"bookmarkType\": 0 }, { \"text\": \".NET Core\" }, { \"name\": \"_Toc523387947\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388457\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"The framework .NET Core 1.1 a is modular, cross-platform, cloud-optimized version of the .NET Framework, consisting of the CoreCLR and the implementation of the .NET Standard Library 1.6. One of the main features of this library is the ability to install only the features that are needed for the application you are building, reducing its footprint and the possibility of installing the library itself within the application. This makes it possible for applications built with different versions to co-exist on the same machine without the compatibility problems typical of the full .NET Framework.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 2\" }, \"inlines\": [{ \"name\": \"_Toc523387948\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388458\", \"bookmarkType\": 0 }, { \"text\": \"ASP.NET Core\" }, { \"name\": \"_Toc523387948\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388458\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"ASP.NET Core is a complete rewrite of ASP.NET, built with the goal of being cross-platform, completely open-source, and without the limitations of backward compatibility. Like .NET Core, ASP.NET Core is also built with a modular approach. This means the application you build can include only the needed features without taking on additional burdens. This is made possible by the new startup and execution environment, based on the Open Web Interface for .NET (OWIN) standard. In addition, ASP.NET Core comes with many interesting features that we are going to see throughout the book, like an integrated \" }, { \"text\": \"dependency injection system and a new application framework that unifies the programming models of ASP.NET MVC and Web API.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 1\" }, \"inlines\": [{ \"name\": \"_Toc523387949\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388459\", \"bookmarkType\": 0 }, { \"text\": \"Chapter 3 \" }, { \"text\": \"Getting Started with .NET Core\" }, { \"name\": \"_Toc523387949\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388459\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Now that it is clear what ASP.NET Core and .NET Core are, and why they were created, it's time to look at how to install them and how to build a simple application with them.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 2\" }, \"inlines\": [{ \"name\": \"_Toc523387950\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388460\", \"bookmarkType\": 0 }, { \"text\": \"Installing .NET Core on Windows\" }, { \"name\": \"_Toc523387950\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388460\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Installing on Windows is pretty easy. With Visual Studio 2017, chances are you already installed it. If not, go back to the Visual Studio Installer and make sure you have the .NET Core workload selected.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 2\" }, \"inlines\": [{ \"name\": \"_Toc523387951\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388461\", \"bookmarkType\": 0 }, { \"text\": \"Installing .NET Core on a Mac (or Linux)\" }, { \"name\": \"_Toc523387951\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388461\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"The beauty of .NET Core is that it can also be installed on a Mac (or Linux, for that matter) without relying on third-party frameworks, as was needed before with Mono.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Each distribution of Linux has its own individual way of installing, but in the end, the process boils down to the same principles:\" }] }, { \"paragraphFormat\": { \"styleName\": \"List Paragraph\", \"listFormat\": { \"listLevelNumber\": 0, \"listId\": 0 } }, \"inlines\": [{ \"text\": \"Install prerequisites and configure the package manager of your distribution.\" }] }, { \"paragraphFormat\": { \"styleName\": \"List Paragraph\", \"listFormat\": { \"listLevelNumber\": 0, \"listId\": 0 } }, \"inlines\": [{ \"text\": \"Invoke the package manager to download and install .NET Core and its tools.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"You can read instructions specific to your distribution on the official .NET Core website. As an example, we’ll show you how to install on a Mac.\" }] }, { \"characterFormat\": { \"italic\": true }, \"paragraphFormat\": { \"textAlignment\": \"Center\", \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Code Listing 3-1\", \"characterFormat\": { \"italic\": true } }] }, { \"rows\": [{ \"rowFormat\": { \"allowBreakAcrossPages\": true, \"isHeader\": false, \"height\": 0.0, \"heightType\": \"AtLeast\", \"borders\": { \"left\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"right\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"top\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"bottom\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"vertical\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"horizontal\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"diagonalDown\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"diagonalUp\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false } } }, \"cells\": [{ \"blocks\": [{ \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \">brew update\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \">brew install openssl\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \">ln -s /usr/local/opt/openssl/lib/libcrypto.1.0.0.dylib /usr/local/lib/\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \">ln -s /usr/local/opt/openssl/lib/libssl.1.0.0.dylib /usr/local/lib/\" }] }], \"cellFormat\": { \"columnSpan\": 1, \"rowSpan\": 1, \"preferredWidth\": 467.