"hasNoneStyle\": false }, \"diagonalDown\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false }, \"diagonalUp\": { \"lineStyle\": \"None\", \"lineWidth\": 0.0, \"shadow\": false, \"space\": 0.0, \"hasNoneStyle\": false } } } }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"Once all these prerequisites have been installed, you can download and install the official SDK for macOS by downloading it from the \" }, { \"hasFieldEnd\": true, \"fieldType\": 0 }, { \"text\": \"HYPERLINK \\\"https://www.microsoft.com/net/core\\\" \" }, { \"fieldType\": 2 }, { \"text\": \"official .NET Core website\", \"characterFormat\": { \"styleName\": \"Hyperlink\" } }, { \"fieldType\": 1 }, { \"text\": \".\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"On Linux and Mac, you do not have Visual Studio to develop apps, but you can use the .NET Core SDK or Visual Studio Code, which is a lightweight, extensible, cross-platform text editor built by Microsoft and the community. The last chapter of this book covers in detail each of the tools with which you can build .NET Core apps.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Heading 1\" }, \"inlines\": [{ \"name\": \"_Toc523387952\", \"bookmarkType\": 0 }, { \"name\": \"_Toc523388462\", \"bookmarkType\": 0 }, { \"text\": \"A Look at the Future\" }, { \"name\": \"_Toc523387952\", \"bookmarkType\": 1 }, { \"name\": \"_Toc523388462\", \"bookmarkType\": 1 }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"The release of .NET Core has been a very difficult one, with many delays and changes in direction. While the framework is stable, with .NET Core 1.1 released in November 2016, the tooling is still in development.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"When we wrote this book, we relied on previews that were made available at the Connect(); event of November 2016, so some of the screenshots or procedures in the examples might be different from what is currently available.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"What can we expect for the future of .NET Core?\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"First, unlike previous frameworks, we have to expect a continuous release of enhanced tools, both for the CLI and for the tooling inside Visual Studio. Second, on the framework side, there will be the second big release of .NET Core 2.0, implementing .NET Standard 2.0.\" }] }, { \"paragraphFormat\": { \"styleName\": \"Normal\" }, \"inlines\": [{ \"text\": \"But rest assured that Microsoft sees .NET Core as the future of .NET for the next 10 years, so this is the right time to jump in and start learning this new technology.\" }] }], \"headersFooters\": {}, \"sectionFormat\": { \"headerDistance\": 36.0, \"footerDistance\": 36.0, \"pageWidth\": 612.0, \"pageHeight\": 792.0, \"leftMargin\": 72.0, \"rightMargin\": 72.0, \"topMargin\": 72.0, \"bottomMargin\": 72.0, \"differentFirstPage\": false, \"differentOddAndEvenPages\": false } }], \"characterFormat\": { \"fontSize\": 11.0, \"fontFamily\": \"Calibri\" }, \"paragraphFormat\": { \"afterSpacing\": 8.0, \"lineSpacing\": 1.0791666507720947, \"lineSpacingType\": \"Multiple\" }, \"lists\": [{ \"listId\": 0, \"abstractListId\": 0 }], \"abstractLists\": [{ \"abstractListId\": 0, \"levels\": [{ \"listLevelPattern\": \"Bullet\", \"followCharacter\": \"Tab\", \"numberFormat\": \"\", \"characterFormat\": { \"fontFamily\": \"Symbol\" }, \"paragraphFormat\": { \"leftIndent\": 36.0, \"firstLineIndent\": -18.0 } }, { \"listLevelPattern\": \"Bullet\", \"followCharacter\": \"Tab\", \"numberFormat\": \"o\", \"characterFormat\": { \"fontFamily\": \"Courier New\" }, \"paragraphFormat\": { \"left