        public static string Rtl = "{\"sections\":[{\"blocks\":[{\"characterFormat\":{\"fontSize\":18,\"fontFamily\":\"Calibri\",\"fontFamilyBidi\":\"Calibri\"},\"paragraphFormat\":{\"beforeSpacing\":18,\"afterSpacing\":30,\"styleName\":\"Heading 1\",\"bidi\":true},\"inlines\":[{\"name\":\"_GoBack\",\"bookmarkType\":0},{\"name\":\"_GoBack\",\"bookmarkType\":1},{\"text\":\"اعمال المغامرة دورات\",\"characterFormat\":{\"fontSize\":18,\"bidi\":true,\"fontSizeBidi\":18}}]},{\"characterFormat\":{\"fontSize\":12},\"paragraphFormat\":{\"firstLineIndent\":36,\"afterSpacing\":6,\"textAlignment\":\"Justify\",\"styleName\":\"Normal\",\"bidi\":true},\"inlines\":[{\"text\":\"المغامرة يعمل دورات ، والشركة الوهمية التي تقوم علي قاعده بيانات نموذج المغامرة ، هي شركه تصنيع كبيره متعددة الجنسيات. وتصنع الشركة وتبيع الدراجات المعدنية والمركبات إلى الأسواق التجارية لأمريكا الشمالية وأوروبا واسيا. وفي حين ان العملية الاساسيه التي تقوم بها تقع في بونيل ، واشنطن التي تضم 290 موظفا ، فان العديد من فرق المبيعات الاقليميه تقع في جميع انحاء قاعدتها السوقية.\",\"characterFormat\":{\"fontSize\":12,\"bidi\":true,\"fontSizeBidi\":12}}]},{\"characterFormat\":{\"fontSize\":12,\"fontSizeBidi\":12},\"paragraphFormat\":{\"styleName\":\"Normal\",\"bidi\":true},\"inlines\":[{\"text\":\"في عام 2000، \\\"دورات الأعمال المغامرة\\\" اشترى مصنع الصناعات التحويلية صغيرة، نبتون إيمبورتادوريس، الموجود في المكسيك. إيمبورتادوريس نبتون المصنوعات عدة مكونات حاسمة لخط المنتج \\\"دورات الأعمال المغامرة\\\". هذه المكونات يتم شحنها إلى موقع بوثيل لتجميع المنتج النهائي. في عام 2001، إيمبورتادوريس نبتون، أصبح المصنع الوحيد وموزع لمجموعة المنتجات الدراجات يجول.\",\"characterFormat\":{\"fontSize\":12,\"bidi\":true,\"fontSizeBidi\":12}}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\",\"bidi\":true},\"inlines\":[{\"text\":\"نظره عامه علي المنتج\",\"characterFormat\":{\"bidi\":true}}]},{\"rows\":[{\"rowFormat\":{\"allowBreakAcrossPages\":true,\"isHeader\":false,\"height\":0,\"heightType\":\"AtLeast\",\"borders\":{\"left\":