        public static string Comments = "{\"sections\":[{\"blocks\":[{\"paragraphFormat\":{\"styleName\":\"Title\"},\"inlines\":[{\"text\":\"The Giant Panda\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The \"},{\"commentId\":\"Comment_e5affde3-0e01-48df-938c-071a057c6f8e\",\"commentCharacterType\":0},{\"text\":\"giant panda\"},{\"commentId\":\"Comment_e5affde3-0e01-48df-938c-071a057c6f8e\",\"commentCharacterType\":1},{\"text\":\", which only lives in China outside of captivity, has captured the hearts of people of all ages across the globe. From their furry black and white bodies to their shy and docile nature, they are considered one of the world's most loved animals.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"imageString\":\"data:image/jpeg;base64,\",\"length\":1,\"width\":467.45001220703125,\"height\":262.75,\"isInlineImage\":true,\"isMetaFile\":false}]},{\"paragraphFormat\":{\"afterSpacing\":0.0,\"lineSpacing\":1.0,\"lineSpacingType\":\"Multiple\",\"styleName\":\"Normal\"},\"inlines\":[{\"commentId\":\"Comment_b99ebea3-29b7-4d2c-8410-ce8fecb2c30d\",\"commentCharacterType\":0},{\"commentId\":\"Comment_dd401ff7-c247-45e8-9d4e-fe9f3fc45603\",\"commentCharacterType\":0},{\"commentId\":\"Comment_c1623cbf-5221-4da7-9158-539d7748f786\",\"commentCharacterType\":0},{\"text\":\"Quick Fact\",\"characterFormat\":{\"bold\":true}},{\"commentId\":\"Comment_b99ebea3-29b7-4d2c-8410-ce8fecb2c30d\",\"commentCharacterType\":1},{\"commentId\":\"Comment_dd401ff7-c247-45e8-9d4e-fe9f3fc45603\",\"commentCharacterType\":1},{\"commentId\":\"Comment_c1623cbf-5221-4da7-9158-539d7748f786\",\"commentCharacterType\":1},{\"text\":\" The estimated number of giant pandas in the wild varies between 1,500 and 3,000.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"text\":\"Intriguing Giant Panda Mysteries\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"While most adore their fluffy fur and round heads, which help give them their cuddly bear quality, others are fascinated by the many mysteries of the giant panda. Did you know that the giant panda \"},{\"commentId\":\"Comment_875b5153-42a7-4f48-930b-f4d4ab5df625\",\"commentCharacterType\":0},{\"commentId\":\"Comment_6f94599b-64a1-4652-a3c4-a57d3e13ae88\",\"commentCharacterType\":0},{\"text\":\"may \"},{\"text\":\"actually be\"},{\"text\":\" a\"},{\"commentId\":\"Comment_875b5153-42a7-4f48-930b-f4d4ab5df625\",\"commentCharacterType\":1},{\"commentId\":\"Comment_6f94599b-64a1-4652-a3c4-a57d3e13ae88\",\"commentCharacterType\":1},{\"text\":\" raccoon, they have an opposable pseudo thumb, and that they’re technically a carnivore even though their diet is primarily vegetarian? These things and more have baffled scientists and naturalists for hundreds of years. \"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"text\":\"Opposable Pseudo Thumb\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"A characteristic of the giant panda that has mystified scientists is their movable, elongated wrist bone that acts like an opposable thumb. This human-like quality that helps give them even more of a cuddly-bear appearance enables the giant panda to pick up objects and even eat sitting up. \"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Quick Fact\",\"characterFormat\":{\"bold\":true}},{\"text\":\" Giant pandas have five clawed toes and one pseudo thumb.\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Their pseudo thumb, along with pads of skin, help the giant panda strip the more nutritious small bamboo shoots and leaves while holding the stalk in their mouth.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"text\":\"Small Bear or Large Raccoon?\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Giant pandas are generally referred to as bears and are typically called panda bears rather than giant pandas. Though we may think they look like bears, there has been a great deal of discussion for decades about where giant pandas fit in the animal kingdom. Much of the debate has been whether they are more closely related to the red panda, once thought to be a member of the raccoon family, than the bear family.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"While a giant panda has a body that resembles a small bear and climbs trees like a bear, it also has several characteristics in common with the red panda. For example, both giant pandas and red pandas eat bamboo and have the same pseudo thumb. The table below lists the main characteristics the giant panda shares with bears and red pandas.\"}]},{\"rows\":[{\"rowFormat\":{\"allowBreakAcrossPages\":true,\"isHeader\":false,\"height\":18.0,\"heightType\":\"AtLeast\",\"borders\":{\"left\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"right\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"top\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"bottom\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"vertical\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"horizontal\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"diagonalDown\":{\"lineStyle\":\"None\",\"lineWidth\":0.0,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false},\"diagonalUp\":{\"lineStyle\":\"None\",\"lineWidth\":0.0,\"shadow\":false,\"space\":0.