        public static string TrackChanges ="{\"sections\":[{\"blocks\":[{\"paragraphFormat\":{\"styleName\":\"Title\"},\"inlines\":[{\"text\":\"ASP.NET Core Succinctly\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"name\":\"_Toc523387945\",\"bookmarkType\":0},{\"name\":\"_Toc523388455\",\"bookmarkType\":0},{\"name\":\"_Toc42015551\",\"bookmarkType\":0},{\"name\":\"_Toc42015586\",\"bookmarkType\":0},{\"text\":\"C\"},{\"text\":\"hapter 1 Introduction to ASP.NET Core\"},{\"name\":\"_Toc523387945\",\"bookmarkType\":1},{\"name\":\"_Toc523388455\",\"bookmarkType\":1},{\"name\":\"_Toc42015551\",\"bookmarkType\":1},{\"name\":\"_Toc42015586\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"A\"},{\"text\":\"SP\",\"revisionIds\":[\"b756b968-3c64-4455-80aa-61b916ed6f80\"]},{\"text\":\"sp\",\"revisionIds\":[\"e8b50102-c9bb-4e08-b827-04728a72980f\"]},{\"text\":\".\"},{\"text\":\"NET\",\"revisionIds\":[\"80a06038-0f6b-4a87-9dae-5518fea6c609\"]},{\"text\":\"net\",\"revisionIds\":[\"2aae587d-9776-4c64-933a-4e2293edec4b\"]},{\"text\":\" \"},{\"text\":\"c\",\"revisionIds\":[\"798ad0fd-21dc-4bdb-922f-fd9aaae7f938\"]},{\"text\":\"C\",\"revisionIds\":[\"6fc9c1f4-5fbd-4857-9955-523011a8c8a7\"]},{\"text\":\"ore is the web develop\"},{\"text\":\" framework that comes together with the ne\"},{\"text\":\"w .NET Core and, besides all the new features,\"},{\"text\":\" \",\"revisionIds\":[\"6ef86691-b42e-4fdc-9c36-126b0d047f29\"]},{\"text\":\"also adopts a significantly new approach to web development. The first chapter starts by going through the history of Microsoft's web stack to show the motivations that led to this framework. Later, it moves t\"},{\"text\":\"o more practical matters, like showing you how to get started with .\"},{\"text\":\"Net\",\"revisionIds\":[\"1a353a7a-aabf-477d-9511-142fb35343e2\"]},{\"text\":\"net\",\"revisionIds\":[\"1c78faa0-3e72-48bc-b973-6f52795d10a4\"]},{\"text\":\" \"},{\"text\":\"c\",\"revisionIds\":[\"b7e55980-4794-4edb-b3d3-15d109d9645d\"]},{\"text\":\"C\",\"revisionIds\":[\"e9e9819b-f471-41f9-b146-eb8134aeaf64\"]},{\"text\":\"ore and describing the foundations of the framework.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"name\":\"_Toc523387946\",\"bookmarkType\":0},{\"name\":\"_Toc523388456\",\"bookmarkType\":0},{\"name\":\"_Toc42015552\",\"bookmarkType\":0},{\"name\":\"_Toc42015587\",\"bookmarkType\":0},{\"text\":\"Chapter 2 What are .NET Core and ASP.NET Core?\"},{\"name\":\"_Toc523387946\",\"bookmarkType\":1},{\"name\":\"_Toc523388456\",\"bookmarkType\":1},{\"name\":\"_Toc42015552\",\"bookmarkType\":1},{\"name\":\"_Toc42015587\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Before trying to understand the reason for its existence, let's first try to define\"},{\"text\":\" what .NET Core and ASP.NET Core are.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"name\":\"_Toc523387947\",\"bookmarkType\":0},{\"name\":\"_Toc523388457\",\"bookmarkType\":0},{\"name\":\"_Toc42015553\",\"bookmarkType\":0},{\"name\":\"_Toc42015588\",\"bookmarkType\":0},{\"text\":\".NET Core\"},{\"name\":\"_Toc523387947\",\"bookmarkType\":1},{\"name\":\"_Toc523388457\",\"bookmarkType\":1},{\"name\":\"_Toc42015553\",\"bookmarkType\":1},{\"name\":\"_Toc42015588\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The framework .NET Core 1.1 a is modular, cross-platform, cloud-optimized version of the .NET Framework, consisting of the \"},{\"text\":\"CoreCLR\"},{\"text\":\" and the implementation of the .NET Standard Library 1.6. One of the main feat\"},{\"text\":\"ures of this library is the ability to install only the features that are needed for the application you are building, reducing its footprint and the possibility of installing the library itself within the application. This makes it possible for applicatio\"},{\"text\":\"ns built with different versions to co-exist on the same machine without the compatibility problems typical of the full .NET Framework.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"name\":\"_Toc523387948\",\"bookmarkType\":0},{\"name\":\"_Toc523388458\",\"bookmarkType\":0},{\"name\":\"_Toc42015554\",\"bookmarkType\":0},{\"name\":\"_Toc42015589\",\"bookmarkType\":0},{\"text\":\"ASP.NET Core\"},{\"name\":\"_Toc523387948\",\"bookmarkType\":1},{\"name\":\"_Toc523388458\",\"bookmarkType\":1},{\"name\":\"_Toc42015554\",\"bookmarkType\":1},{\"name\":\"_Toc42015589\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"ASP.NET Core is a complete rewrite of ASP.NET, built with the goal of being cross-platform, complete\"},{\"text\":\"ly\",\"revisionIds\":[\"0a876474-7164-4c1e-8b97-a18a855e421f\"]},{\"text\":\" open\"},{\"text\":\"-source, and without the limitations of backward compatibility. Like .NET Core, ASP.NET Core is also built with a modular approach. This means the application you build can include only the needed features without taking on additional burdens. This is made\"},{\"text\":\" possible by the new startup and execution environment, based on the Open Web Interface for .NET (OWIN) standard. In addition, ASP.NET Core comes with many interesting features that we are going to see throughout the book, like an integrated dependency inj\"},{\"text\":\"ection system and a new application framework that unifies the programming models of ASP.NET MVC and Web API.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"name\":\"_Toc523387949\",\"bookmarkType\":0},{\"name\":\"_Toc523388459\",\"bookmarkType\":0},{\"name\":\"_Toc42015555\",\"bookmarkType\":0},{\"name\":\"_Toc42015590\",\"bookmarkType\":0},{\"text\":\"Chapter 3 Getting Started with .NET Core\"},{\"name\":\"_Toc523387949\",\"bookmarkType\":1},{\"name\":\"_Toc523388459\",\"bookmarkType\":1},{\"name\":\"_Toc42015555\",\"bookmarkType\":1},{\"name\":\"_Toc42015590\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Now that it is clear what ASP.NET Core and .NET Core are, and why they were created, it's time to look at how to install them and how to build a simple application with them.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"name\":\"_Toc523387950\",\"bookmarkType\":0},{\"name\":\"_Toc523388460\",\"bookmarkType\":0},{\"name\":\"_Toc42015556\",\"bookmarkType\":0},{\"name\":\"_Toc42015591\",\"bookmarkType\":0},{\"text\":\"Install\"},{\"text\":\"ing\",\"revisionIds\":[\"9f6e263c-7289-4dad-9292-0455f375da73\"]},{\"text\":\" .NET Core on Windows\"},{\"name\":\"_Toc523387950\",\"bookmarkType\":1},{\"name\":\"_Toc523388460\",\"bookmarkType\":1},{\"name\":\"_Toc42015556\",\"bookmarkType\":1},{\"name\":\"_Toc42015591\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Installing on Windows is \"},{\"text\":\"pretty easy\",\"revisionIds\":[\"d6d85993-c119-4223-8299-bbfb7072bab4\"]},{\"text\":\"easy\",\"revisionIds\":[\"55973d80-9fa5-4d4f-9bad-dd72e1475b6f\"]},{\"text\":\". With Visual\"},{\"text\":\" Studio 2017, chances are you already installed it. If not, go back to the Visual Studio Installer and make sure you have the .NET Core workload selected.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"name\":\"_Toc523387951\",\"bookmarkType\":0},{\"name\":\"_Toc523388461\",\"bookmarkType\":0},{\"name\":\"_Toc42015557\",\"bookmarkType\":0},{\"name\":\"_Toc42015592\",\"bookmarkType\":0},{\"text\":\"Install\"},{\"text\":\"ing\",\"revisionIds\":[\"a3330ddc-0b35-4102-8fed-74bddc293e57\"]},{\"text\":\" .NET Core on a Mac (or Linux)\"},{\"name\":\"_Toc523387951\",\"bookmarkType\":1},{\"name\":\"_Toc523388461\",\"bookmarkType\":1},{\"name\":\"_Toc42015557\",\"bookmarkType\":1},{\"name\":\"_Toc42015592\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The beauty of .NET Core is that it can also be installed on \"},{\"text\":\"a Mac (or Linux, for that matter) without relying on third-party frameworks, as was needed before with Mono.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Each distribution of Linux has its own individual way of installing, but in the end, the process boils down to the same principles:\"}]},{\"paragraphFormat\":{\"styleName\":\"List Paragraph\",\"listFormat\":{\"listLevelNumber\":0,\"listId\":0}},\"inlines\":[{\"text\":\"Install prerequisites and configure the package manager of your distribution.\"}]},{\"paragraphFormat\":{\"styleName\":\"List Paragraph\",\"listFormat\":{\"listLevelNumber\":0,\"listId\":0}},\"inlines\":[{\"text\":\"Invoke the package manager to download and install .NET Core and its tools.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"You can read instructions specific to your distribution on the official .NET Core website. As an examp\"},{\"text\":\"le, we’ll show you how to install on a Mac.\"}]},{\"characterFormat\":{\"italic\":true},\"paragraphFormat\":{\"textAlignment\":\"Center\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Code Listing 3-1\",\"characterFormat\":{\"italic\":true}}]},{\"rows\":[{\"rowFormat\":{\"allowBreakAcrossPages\":true,\"isHeader\":false,\"height\":1.0,\"heightType\":\"AtLeast\",\"borders\":{\"left\":{\"lineStyle\":\"Single\",\"lineWidth\":0.5,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false},\"right\":{\"lineStyle\":\"Single\",\"lineWidth\":0.5,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false},\"top\":{\"lineStyle\":\"Single\",\"lineWidth\":0.5,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false},\"bottom\":{\"lineStyle\":\"Single\",\"lineWidth\":0.5,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false},\"vertical\":{\"lineStyle\":\"Single\",\"lineWidth\":0.5,\"shadow\":fa