ou can use the .NET Core SDK or Visual Studio Code, which is a lightweight, extensible, cross-platform text editor built by Microsoft and the community. The last chapter of this book covers in detail each of the tools with which you can build .NET \"},{\"text\":\"Core apps.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"name\":\"_Toc523387952\",\"bookmarkType\":0},{\"name\":\"_Toc523388462\",\"bookmarkType\":0},{\"name\":\"_Toc42015558\",\"bookmarkType\":0},{\"name\":\"_Toc42015593\",\"bookmarkType\":0},{\"text\":\"A Look at the Future\"},{\"name\":\"_Toc523387952\",\"bookmarkType\":1},{\"name\":\"_Toc523388462\",\"bookmarkType\":1},{\"name\":\"_Toc42015558\",\"bookmarkType\":1},{\"name\":\"_Toc42015593\",\"bookmarkType\":1}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The release of .NET Core has been a very difficult one, with many delays and changes in direction. While the framework is stable, with .NET Core 1.1 released in November 2016, the tooling is still in development.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"When we wro\"},{\"text\":\"te this book, we relied on previews that were made available at the \"},{\"text\":\"Con\"},{\"name\":\"_GoBack\",\"bookmarkType\":0},{\"name\":\"_GoBack\",\"bookmarkType\":1},{\"text\":\"nect(\"},{\"text\":\"); event of November 2016, so some of the screenshots or procedures in the examples might be different from what is currently available.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"What can we expect for the future of .NET C\"},{\"text\":\"ore?\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"First, unlike previous frameworks, we \"},{\"text\":\"have to\",\"revisionIds\":[\"3742a158-cadf-4848-b105-ca2cbcde35c7\"]},{\"text\":\"must\",\"revisionIds\":[\"666ca6c2-ac2b-49b5-bfdb-dff924672b91\"]},{\"text\":\" expect a continuous release of enhanced tools, both for the CLI an