        public static string Notes = "{\"sections\":[{\"blocks\":[{\"paragraphFormat\":{\"styleName\":\"Title\"},\"inlines\":[{\"text\":\"The Giant Panda\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"The giant panda\"},{\"footnoteType\":\"Footnote\",\"characterFormat\":{\"styleName\":\"Footnote Reference\"},\"blocks\":[{\"paragraphFormat\":{\"styleName\":\"Footnote Text\"},\"inlines\":[{\"text\":\"\\u0002\",\"characterFormat\":{\"styleName\":\"Footnote Reference\"}},{\"text\":\" \"},{\"text\":\"Giant panda also known as panda bear or simply panda, is a bear native to south central China.\"}]}],\"symbolCode\":0,\"symbolFontName\":\"Symbol\"},{\"text\":\", which only lives in China outside of captivity, has captured the hearts of people of all ages across \"},{\"text\":\"\\u000b\"},{\"text\":\"the globe. From their furry black and w\"},{\"name\":\"_GoBack\",\"bookmarkType\":0},{\"name\":\"_GoBack\",\"bookmarkType\":1},{\"text\":\"hite bodies to their shy and docile nature, they are considered one of the world's most loved animals.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"imageString\":\"data:image/jpeg;base64,\",\"length\":1,\"width\":467.45001220703127,\"height\":262.75,\"isInlineImage\":true,\"isMetaFile\":false,\"top\":0.0,\"bottom\":0.0,\"right\":0.0,\"left\":0.0,\"getimageheight\":0.0,\"getimagewidth\":0.0}]},{\"paragraphFormat\":{\"afterSpacing\":0.0,\"lineSpacing\":1.0,\"lineSpacingType\":\"Multiple\",\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Quick Fact\",\"characterFormat\":{\"bold\":true}},{\"footnoteType\":\"Endnote\",\"characterFormat\":{\"styleName\":\"Endnote Reference\"},\"blocks\":[{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"\\u0002\",\"characterFormat\":{\"styleName\":\"Endnote Reference\"}},{\"text\":\" \"},{\"text\":\"Giant pandas are good at climbing trees and can also swim.\"},{\"text\":\" \"},{\"text\":\"An adult can eat 12–38 kilos of bamboo per day\"},{\"text\":\".\"}]}],\"symbolCode\":0,\"symbolFontName\":\"Symbol\"},{\"text\":\" The estimated number of giant pandas in the wild varies between 1,500 and 3,000.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 1\"},\"inlines\":[{\"text\":\"Intriguing \"},{\"text\":\"Giant Panda Mysteries\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"While most adore their fluffy fur and round heads, which help give them their cuddly bear quality, others are fascinated by the many mysteries of the giant panda. Did you know that the giant panda may \"},{\"text\":\"actually be\"},{\"text\":\" a\"},{\"text\":\" raccoon, they\"},{\"text\":\" have an opposable pseudo thumb, and that they’re technically a carnivore even though their diet is primarily vegetarian? These things and more have baffled scientists and naturalists for hundreds of years. \"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"text\":\"Opposable Pseudo Thumb\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"A characteristic of the g\"},{\"text\":\"iant panda that has mystified scientists is their movable, elongated wrist bone that acts like an opposable thumb. This human-like quality that helps give them even more of a cuddly-bear appearance enables the giant panda to pick up objects and even eat si\"},{\"text\":\"tting up. \"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Quick Fact\",\"characterFormat\":{\"bold\":true}},{\"text\":\" Giant pandas have five clawed toes and one pseudo thumb.\"}]},{\"paragraphFormat\":{\"afterSpacing\":6.0,\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Their pseudo thumb, along with pads of skin, help the giant panda strip the more nutritious small bamboo shoots and leaves while holding the stalk in their mouth.\"}]},{\"paragraphFormat\":{\"styleName\":\"Heading 2\"},\"inlines\":[{\"text\":\"Small Bear or \"},{\"text\":\"Large Raccoon?\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"Giant pandas are generally referred to as bears and are typically called panda bears rather than giant pandas. Though we may think they look like bears, there has been a great deal of discussion for decades about where giant pandas fit in th\"},{\"text\":\"e animal kingdom. Much of the debate has been whether they are more closely related to the red panda, once thought to be a member of the raccoon family, than the bear family.\"}]},{\"paragraphFormat\":{\"styleName\":\"Normal\"},\"inlines\":[{\"text\":\"While a giant panda has a body that resembles a small bear and climbs trees like \"},{\"text\":\"a bear, it also has several characteristics in common with the red panda. For example, both giant pandas and red pandas eat bamboo and have the same pseudo thumb. The table below lists the main characteristics the giant panda shares with bears and red pand\"},{\"text\":\"as.\"}]},{\"rows\":[{\"rowFormat\":{\"allowBreakAcrossPages\":true,\"isHeader\":false,\"height\":18.0,\"heightType\":\"AtLeast\",\"borders\":{\"left\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"right\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"top\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"bottom\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"vertical\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"horizontal\":{\"lineStyle\":\"Single\",\"lineWidth\":0.75,\"shadow\":false,\"space\":0.0,\"hasNoneStyle\":false,\"color\":\"#A6A6A6FF\"},\"diagonalDown\":{\"lineStyle\":\"None\",\"lineWidth\":0.0,\"sh